import React, { useEffect, useState } from 'react'

function Iphone11() {

    const [iphone,setIphone] = useState()

       const getIphone = async ()=>{
        const url = "http://localhost:5000/iphone/iphone11"

        const response = await fetch(url);
        const responseJson = await response.json();

        setIphone(responseJson.iphone)
    }

        useEffect(()=>{
          getIphone()
        },[])

  return (

    <div>



    {iphone && iphone.map((i)=>


    <div key={i._id} className="card" style="">
    <img src={i.img} className="card-img-top" alt={i.name}/>
    <div className="card-body">
    <h5 className="card-title">{i.name}</h5>
    <p className="card-text">{i.price}</p>
    <p className="card-text">{i.countInStock}</p>

        </div>
        </div>

    )}


</div>
  )
}

export default Iphone11
